INSERT INTO `recruitment_info` VALUES (5101, 4002, '软件测试', '7500', '天津市', '在校生', '硕士', '岗位职责：\n1、根据战略规划，结合行业趋势、竞品、CXO用户视角，梳理预算类、管理会计类产品的价值定位；\n2、结合企业经营视角，从战略与执行，决策与数据的大逻辑出发，发现、识别用户痛点，进行需求分析，提炼产品特性、价值亮点，完成产品规划；\n3、与研发、设计、运营等角色或部门有效沟通，确保其充分理解产品，保证产品的日常迭代与最终的落地兑现；\n4、深入产品项目交付赋能过程，识别产品的优化点，和产品团队共同进行优化迭代，打造标杆客户，推动产品的持续更新和客户深度应用。', '暂无福利', '2021-03-15 16:41:21');
INSERT INTO `recruitment_info` VALUES (5101, 4003, 'java工程师', '3-5K', '上海', '在校生', '本科', '岗位职责：\n1、根据战略规划，结合行业趋势、竞品、CXO用户视角，梳理预算类、管理会计类产品的价值定位；\n2、结合企业经营视角，从战略与执行，决策与数据的大逻辑出发，发现、识别用户痛点，进行需求分析，提炼产品特性、价值亮点，完成产品规划；\n3、与研发、设计、运营等角色或部门有效沟通，确保其充分理解产品，保证产品的日常迭代与最终的落地兑现；\n4、深入产品项目交付赋能过程，识别产品的优化点，和产品团队共同进行优化迭代，打造标杆客户，推动产品的持续更新和客户深度应用。', '双休,外出旅游,下午茶,965', '2021-03-15 16:17:37');
