-- ----------------------------
-- Procedure structure for prc_gen_user
-- ----------------------------
DROP PROCEDURE IF EXISTS `prc_gen_user`;
delimiter ;;
CREATE PROCEDURE `prc_gen_user`(l_cnt int)
BEGIN
   DECLARE x INT DEFAULT 0;
   DECLARE m1 INT DEFAULT 0;
   DECLARE m2 INT DEFAULT 0;
   WHILE x < l_cnt
   DO
      SET x = x + 1;
			SET m1 = FLOOR(3000+RAND() * (50000))/1000;
			SET m2 = m1 + FLOOR(RAND() * (3000))/1000;
														u_id,
														p_id,
														r_id,
														created_time,
														is_delete
                       )
         VALUES (
                   
                   x,
									FLOOR(1+RAND() * (3999)),
									x,
							            concat('2021-',
                          3 ,
                          '-',
                          1 + ceiling(rand() * 100) % 13),
													0
													
									 );

   END WHILE;
END
;;
delimiter ;

